import React, { useState, useEffect, useRef } from 'react';
import LeftBackgroundOval from '../public/icons/left-background-oval';
import RightBackgroundOval from '../public/icons/right-background-oval';
import styles from '../styles/Home.module.css';
import BackgroundIcon from '../components/background-icon';
import TextCircle from '../components/text-circle';
import { HiOutlineArrowNarrowRight } from 'react-icons/hi';
import LoadingText from './loading-text';


type Props = {}

const Loading = (props: Props) => {

    const [hasPageFullyLoaded, setHasPageFullyLoaded] = useState<boolean>(false);
    const [delayTyping, setDelayTyping] = useState<number>(400);
    const [text, setText] = useState<string>("lamide");
    const [index, setIndex] = useState<number>(0);
    const [isTextCompleted, setIsTextCompleted] = useState<boolean>(false);

    const loadingTextRefElement = useRef<HTMLParagraphElement>(null) as React.MutableRefObject<HTMLParagraphElement>;

    const printText = () => {
        if (index < text?.length) {
            loadingTextRefElement.current.innerText += text.charAt(index);
            setIndex(index => index + 1);
        }
        else if (index === text?.length) {
            setIsTextCompleted(true);
            loadingTextRefElement.current.insertAdjacentHTML(
                'beforeend',
                `<span class="text-green-500 animate-pulse">.</code>`,
            );
        }
    }

    useEffect(() => {
        const printTextTimeOut = setTimeout(printText, delayTyping);
        return () => clearTimeout(printTextTimeOut);
    }, [index]);

    useEffect(() => {

        let isSubscribed = true;

        let isTimeOutCompleted: NodeJS.Timeout;

        if (isSubscribed) {
            if (isTextCompleted) {
                isTimeOutCompleted = setTimeout(() => {
                    console.log('inside the main home page');
                    setHasPageFullyLoaded(true);
                }, 2000)
            }
        }

        return () => {
            isSubscribed = false;
            clearTimeout(isTimeOutCompleted);
        }
    }, [isTextCompleted]);

    return (
        <div className={`absolute left-0 top-0 flex items-center justify-center w-full h-screen 
            bg-white-bg opacity-100  ${hasPageFullyLoaded && "opacity-0 transition duration-500 ease-in-out"}`}>

            {/* <TextCircle text={"design is life - design is life - design is life - "} className={""} /> */}
            <LoadingText
                isTextCompleted={isTextCompleted}
                loadingTextRefElement={loadingTextRefElement}
            /><svg width="374" height="464" viewBox="0 0 374 464" fill="none" xmlns="http://www.w3.org/2000/svg" xmlns:xlink="http://www.w3.org/1999/xlink">
<rect x="0.710449" y="0.210625" width="372.579" height="462.905" fill="url(#pattern0)"/>
<defs>
<pattern id="pattern0" patternContentUnits="objectBoundingBox" width="1" height="1">
<use xlink:href="#image0_679_217" transform="translate(-0.267361 -0.170391) scale(0.00399182 0.0032113)"/>
</pattern>
<image id="image0_679_217" width="421" height="421" xlink:href="data:image/png;base64,"/>
</defs>
</svg>

            {/* <div className="">
                <BackgroundIcon 
                    className="w-[70rem] h-full absolute top-0 right-0 z-10" 
                    backgroundSvgIcon={<RightBackgroundOval className="w-full h-full" />} 
                />

                <BackgroundIcon 
                    className="w-[70rem] h-full absolute top-0 left-0 z-0" 
                    backgroundSvgIcon={<LeftBackgroundOval className="w-full h-full" />} 
                />
            </div> */}

        </div>
    )
}

export default Loading